    null,nt"notes": "This is a raster grid dataset (1-Meter Resolution) of the
    ground points derived from the acquired LiDAR. The Light Detection and Ranging (LiDAR)
    DEM dataset is a topographic survey conducted for the LaCrosse County LiDAR Survey.
    These data were produced for LaCrosse County. The LaCrosse County LiDAR Survey consists
    of 654 tiles. The LiDAR point cloud was flown at a density sufficient to support
    a maximum final post spacing of 3-meters for unobscured areas. 3001 Inc. acquired
    54 flightlines from April 20-25, 2007 through . The data was divided into 5000'
    by 5000' cells that serve as the final tiling scheme. The LaCrosse County LiDAR
    Survey was collected under the guidance of a Professional Mapper /Surveyor.",nt"license_title":
